  const [state, setState] = useState(null)

  function setStateRandom(){
    setState(Math.floor(Math.random() * 100))
  }

  return (
    <>
    <button onClick={setStateRandom}>Click</button>
    <div>{state}</div>
    </>
  )
}

export default App;
